  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this work is to estimate
  the occurrence, distribution, approximate locations, and abundance of red sesbania
  (Sesbania punicea) and four other major invasive riparian plant species: arundo
  (Arundo donax), saltcedar (Tamarix spp.), perennial pepperweed (Lepidium latifolium),
  and Chinese tallow (Sapium sebiferum) along the San Joaquin River and some adjoining
  channels between Friant Dam and the confluence with the Merced River. Adjoining
  channels include the Chowchilla Bypass, the Eastside Bypass, and parts of Fresno
  Slough, Salt Slough, and Mud Slough. The location of incidental observations of
  additional species including catalpa trees (Catalpa sp.) and tree of heaven (Ailanthus
  altissima) are included with this dataset. The distribution and density of red sesbania
  on the five SJR reaches and bypasses of the SJRRP are currently unknown. Recent
  colonization and rapid spread of red sesbania in the SJR system means existing remote
  imagery is likely to be inadequate to accurately map the distribution and estimated
  abundance of this and other aggressive invasive riparian plant species. In order
  to develop a managment plan for the most aggressive invasive riparian plant species
  in the SJRRP, current knowledge of their distribution, approximate locations, and
  estimated abundance in the SJRRP is required.\",\n\t\"license_title\": null,\n\t\"extras\":
